import {makeStyles} from "@material-ui/core/styles";

export const useStyles = makeStyles(theme => {
    theme.mixins.toolbar.minHeight = 16
    return {
        toolbar: theme.mixins.toolbar,
        content: {
            flexGrow: 1,
            display: 'flex',
            flexDirection: 'column',
            padding: '0 16px',
        },
    }
});
